parts:
{
  "name": "UBX-LOG-BATCH",
  "class_id": "0x21",
  "message_id": "0x11",
  "description": "Batched data",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 100
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "name": "contentValid",
        "byte_offset": 1,
        "data_type": "X1",
        "description": "Content validity flags (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "extraPvt",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Extra PVT information is valid"
            },
            {
              "name": "extraodo",
              "bit_start": 1,
              "bit_end": 1,
              "description": "Odometer data is valid"
            }
          ]
        }
      },
      {
        "name": "msgCnt",
        "byte_offset": 2,
        "data_type": "U2",
        "description": "Message counter; increments for each sent UBX-LOG-BATCH message."
      },
      {
        "name": "iTOW",
        "byte_offset": 4,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See the description of iTOW for details. Only valid if extraPvt is set.",
        "unit": "ms"
      },
      {
        "name": "year",
        "byte_offset": 8,
        "data_type": "U2",
        "description": "Year (UTC)",
        "unit": "y"
      },
      {
        "name": "month",
        "byte_offset": 10,
        "data_type": "U1",
        "description": "Month, range 1..12 (UTC)",
        "unit": "month"
      },
      {
        "name": "day",
        "byte_offset": 11,
        "data_type": "U1",
        "description": "Day of month, range 1..31 (UTC)",
        "unit": "d"
      },
      {
        "name": "hour",
        "byte_offset": 12,
        "data_type": "U1",
        "description": "Hour of day, range 0..23 (UTC)",
        "unit": "h"
      },
      {
        "name": "min",
        "byte_offset": 13,
        "data_type": "U1",
        "description": "Minute of hour, range 0..59 (UTC)",
        "unit": "min"
      },
      {
        "name": "sec",
        "byte_offset": 14,
        "data_type": "U1",
        "description": "Seconds of minute, range 0..60 (UTC)",
        "unit": "s"
      },
      {
        "name": "valid",
        "byte_offset": 15,
        "data_type": "X1",
        "description": "Validity flags (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "validTime",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid UTC Time of Day"
            },
            {
              "name": "validDate",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = valid UTC Date"
            }
          ]
        }
      },
      {
        "name": "tAcc",
        "byte_offset": 16,
        "data_type": "U4",
        "description": "Time accuracy estimate (UTC) Only valid if extraPvt is set.",
        "unit": "ns"
      },
      {
        "name": "fracSec",
        "byte_offset": 20,
        "data_type": "I4",
        "description": "Fraction of second, range -1e9 .. 1e9 (UTC)",
        "unit": "ns"
      },
      {
        "name": "fixType",
        "byte_offset": 24,
        "data_type": "U1",
        "description": "GNSSfix Type: 0: no fix, 2: 2D-fix, 3: 3D-fix"
      },
      {
        "name": "flags",
        "byte_offset": 25,
        "data_type": "X1",
        "description": "Fix status flags (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "gnssFixOK",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid fix (i.e within DOP & accuracy masks)"
            },
            {
              "name": "diffSoln",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = differential corrections were applied"
            },
            {
              "name": "psmState",
              "bit_start": 2,
              "bit_end": 4,
              "description": "Power save mode state (0: PSM is not active, 1: Enabled, 2: Acquisition, 3: Tracking, 4: Power optimized tracking, 5: Inactive)"
            }
          ]
        }
      },
      {
        "name": "flags2",
        "byte_offset": 26,
        "data_type": "X1",
        "description": "Additional flags"
      },
      {
        "name": "numSV",
        "byte_offset": 27,
        "data_type": "U1",
        "description": "Number of satellites used in Nav Solution Only valid if extraPvt is set."
      },
      {
        "name": "lon",
        "byte_offset": 28,
        "data_type": "I4",
        "description": "Longitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        }
      },
      {
        "name": "lat",
        "byte_offset": 32,
        "data_type": "I4",
        "description": "Latitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        }
      },
      {
        "name": "height",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "Height above ellipsoid",
        "unit": "mm"
      },
      {
        "name": "HMSL",
        "byte_offset": 40,
        "data_type": "I4",
        "description": "Height above mean sea level Only valid if extraPvt is set.",
        "unit": "mm"
      },
      {
        "name": "hAcc",
        "byte_offset": 44,
        "data_type": "U4",
        "description": "Horizontal accuracy estimate",
        "unit": "mm"
      },
      {
        "name": "vAcc",
        "byte_offset": 48,
        "data_type": "U4",
        "description": "Vertical accuracy estimate Only valid if extraPvt is set.",
        "unit": "mm"
      },
      {
        "name": "velN",
        "byte_offset": 52,
        "data_type": "I4",
        "description": "NED north velocity Only valid if extraPvt is set.",
        "unit": "mm/s"
      },
      {
        "name": "velE",
        "byte_offset": 56,
        "data_type": "I4",
        "description": "NED east velocity Only valid if extraPvt is set.",
        "unit": "mm/s"
      },
      {
        "name": "velD",
        "byte_offset": 60,
        "data_type": "I4",
        "description": "NED down velocity Only valid if extraPvt is set.",
        "unit": "mm/s"
      },
      {
        "name": "gSpeed",
        "byte_offset": 64,
        "data_type": "I4",
        "description": "Ground Speed (2-D)",
        "unit": "mm/s"
      },
      {
        "name": "headMot",
        "byte_offset": 68,
        "data_type": "I4",
        "description": "Heading of motion (2-D)",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 0.00001
        }
      },
      {
        "name": "sAcc",
        "byte_offset": 72,
        "data_type": "U4",
        "description": "Speed accuracy estimate Only valid if extraPvt is set.",
        "unit": "mm/s"
      },
      {
        "name": "headAcc",
        "byte_offset": 76,
        "data_type": "U4",
        "description": "Heading accuracy estimate Only valid if extraPvt is set.",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 0.00001
        }
      },
      {
        "name": "pDOP",
        "byte_offset": 80,
        "data_type": "U2",
        "description": "Position DOP Only valid if extraPvt is set.",
        "scale": {
          "raw": "0.01",
          "multiplier": 0.01
        }
      },
      {
        "name": "reserved1",
        "byte_offset": 82,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "reserved": true,
        "description": "Reserved"
      },
      {
        "name": "distance",
        "byte_offset": 84,
        "data_type": "U4",
        "description": "Ground distance since last reset Only valid if extraodo is set.",
        "unit": "m"
      },
      {
        "name": "totalDistance",
        "byte_offset": 88,
        "data_type": "U4",
        "description": "Total cumulative ground distance Only valid if extraodo is set.",
        "unit": "m"
      },
      {
        "name": "distanceStd",
        "byte_offset": 92,
        "data_type": "U4",
        "description": "Ground distance accuracy (1-sigma) Only valid if extraodo is set.",
        "unit": "m"
      },
      {
        "name": "reserved2",
        "byte_offset": 96,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "reserved": true,
        "description": "Reserved"
      }
    ]
  }
}
